import React, { useContext, useEffect } from "react";
import { AnimeContexte } from "../contexte/AnimeContexte";

const Home = () => {
  const { fetchAnime, animes, animesbysearch } = useContext(AnimeContexte);
  useEffect(() => {
    fetchAnime();
    // return () => {
    //   clearActeur();
    // };
  }, []);

  return (
    <div>
      {animes.map((anime) => (
        <div>
          {/* <p>{anime.attributes.ageRating}</p> */}
          <p>{anime.attributes.titles.ja_jp}</p>
          <p>{anime.attributes.ageRating}</p>
        </div>
      ))}
    </div>
  );
};

export default Home;
